insert  into `log`(`id`,`created`,`updated`,`deletable`,`editable`,`author_id`,`ref_id`,`type`,`number`,`name`,`date`,`status`,`query`,`author_name`,`ref_type`,`ref_number`,`ref_name`,`ref_date`,`ref_status`) values (93,'2018-06-28 15:55:22','2018-06-28 15:55:22',1,1,1,19,'Section','','Edit section History Content 1 to History Content 1',1530176122,'','UPDATE `section` SET `name` = \'History Content 1\', `title` = \'HISTORY OF<br>SUNGAI BUDI GROUP\', `custom_text_1` = \'\', `custom_text_2` = \'\', `description` = \'<p>Sungai Budi Group (SBG) is engaged in the agribusiness industry in scope of various raw material, such as: Cassava, Palm Oil, Coconut, Rice Flour, Pineapple, Coffee, Rubber and other industrial materials.</p>\\n<p>&nbsp;</p>\\n<p>Sungai Budi Group&rsquo;s development is tremendously increasing not only in industrial raw materials but also consumer processing products such as: Cassava/ Tapioca Starch, Sweeteners, Cooking Oil, Margarine, White and Glutinous, Rice Flour, Rive Vermicelli, Canned Pineapple, Pineapple juice Concentrate, Desiccated Coconut and Coconut Cream.</p>\\n<p>&nbsp;</p>\\n<p>At present, Sungai Budi Group continues to strive to be the best in serving the need of society, either as producer of processed raw material or finished product. Not only in the prominent service we provide, but also continuously maintaining the quality of materials processing which could be optimally beneficial to costumers.</p>\\n<p>&nbsp;</p>\\n<p>Sungai Budi Group is also supported by sophisticated tools and modern sustaining green environment as concerning our productions are derived from Indonesian natural land.</p>\\n<p>&nbsp;</p>\\n<p>However, the business we do, it&rsquo;s not only just a business but also participates and support for the rule of world global warming issue, Indeed, we realize for the earth saving, so with a high profile of our company that we only produce&nbsp;raw materials derived from the natural green resources of Indonesia.</p>\', `name_lang` = \'\', `title_lang` = \'\', `custom_text_1_lang` = \'\', `custom_text_2_lang` = \'\', `description_lang` = \'\' WHERE `id` =  \'19\'','Super Admin','','','',0,'');
