  `category_number` varchar(128) NOT NULL DEFAULT '',
  `category_name` varchar(255) NOT NULL DEFAULT '',
  `category_date` int(10) unsigned NOT NULL DEFAULT '0',
  `category_status` varchar(128) NOT NULL DEFAULT '',
