  `corporate_number` varchar(128) NOT NULL DEFAULT '',
  `corporate_name` varchar(255) NOT NULL DEFAULT '',
  `corporate_date` int(10) unsigned NOT NULL DEFAULT '0',
  `corporate_status` varchar(128) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `author_id` (`author_id`),
  KEY `date` (`date`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

