insert  into `section`(`id`,`created`,`updated`,`deletable`,`editable`,`author_id`,`header_id`,`type`,`number`,`name`,`date`,`status`,`title`,`subtitle`,`description`,`custom_text_1`,`custom_text_2`,`link`,`name_lang`,`title_lang`,`subtitle_lang`,`description_lang`,`custom_text_1_lang`,`custom_text_2_lang`,`no_name`,`no_title`,`no_subtitle`,`no_description`,`no_link`,`no_image`,`no_custom_text_1`,`no_custom_text_2`,`author_name`,`header_type`,`header_number`,`header_name`,`header_date`,`header_status`) values (19,'2000-01-01 00:00:00','2000-01-01 00:00:00',0,1,1,2,'','','History Content 1',0,'','HISTORY OF<br>SUNGAI BUDI GROUP','','<p>Sungai Budi Group (SBG) is engaged in the agribusiness industry in scope of various raw material, such as: Cassava, Palm Oil, Coconut, Rice Flour, Pineapple, Coffee, Rubber and other industrial materials.</p>\n<p>&nbsp;</p>\n<p>Sungai Budi Group&rsquo;s development is tremendously increasing not only in industrial raw materials but also consumer processing products such as: Cassava/ Tapioca Starch, Sweeteners, Cooking Oil, Margarine, White and Glutinous, Rice Flour, Rive Vermicelli, Canned Pineapple, Pineapple juice Concentrate, Desiccated Coconut and Coconut Cream.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','','','','','','','','','',0,0,1,0,1,0,0,0,'Super Admin','Navbar','','ABOUT US',0,'');
